    return(
        <header className='header'>
            <h1>{title}</h1>
            <Button color='green' text={'showAdd' ? 'Add' : 'close'} onClick={onAdd} /> 

        </header>
    )
}

Header.defaultProps = {
    title: 'Task Tracker',
}

Header.propTypes = {
    title: PropTypes.string,
}

